import { FC } from "react";
import { TodoData } from "../TodoData";
import Todo from "./Todo";

type TodoListProps = {
  todos: TodoData[];
  onTodoUpdate: (id: number, done: boolean) => void;
};

const TodoList: FC<TodoListProps> = ({ todos, onTodoUpdate }) => {
  return (
    <div>
      <ul>
        {todos.map(({ id, done, name }) => (
          <li>
            <Todo
              onDoneChange={(done) => {
                onTodoUpdate(id, done);
              }}
              done={done}
              name={name}
            />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
